export const themeStyle = {
  light: {
    bgColor: "#F8F7F4",
    textColor: "#31302E",
    borderColor: "1.5px solid #767676",
  },
  dark: {
    bgColor: "#1E1E22",
    textColor: "#ccc",
    borderColor: "1.5px solid #C4C4C4",
  },
};
